import React from 'react';
import { Link } from 'react-router-dom';


export default function Header() {
const handleLogout = () => {
localStorage.removeItem("token");
window.location.href = "/login";
};


return (
<header className="bg-dark text-white py-3 px-4 d-flex justify-content-between align-items-center">
<h4 className="m-0">VisTrack</h4>
<div>
<Link to="/dashboard" className="btn btn-outline-light me-2">Dashboard</Link>
<Link to="/reception" className="btn btn-outline-light me-2">Reception</Link>
<button onClick={handleLogout} className="btn btn-danger">Logout</button>
</div>
</header>
);
}
